import React from "react";

 function card() {

    return (
        <div className ="card">
        <div className ="card-body">
        <h4 classname = "card-title"> My Title </h4>
        <p className = "card-text text-secondary"> Ssup </p>
        </div>
        </div>
    )
    
 }

 export default card;
